import Button from 'react-bootstrap/Button';

function NewButton() {
    const shoot = () => {
        alert("Nice shoot ")
    }


  return (
    <>
      <Button onClick={shoot} variant="success">Shoot</Button>{' '}
    </>
  );
}

export default NewButton;
